import React from 'react';
import './Spinner.css';

class Spinner extends React.Component{
	constructor(props){
		super(props);
		console.log(props);

	}
	renderContent(){
		// return <div className ="spinner-2"></div>
		let num = Math.floor(Math.random() * Math.floor(3));

		switch(this.props.spinnerType){
			case 0:
				return 	<div class="spinner-1"></div>;
			case 1:
				return 	<div class="spinner-2"></div>;
			case 2:
				return (
					<div class="spinner-3">
					<span class="circle color-1"></span>
					<span class="circle color-2"></span>
					<span class="circle color-3"></span>
				</div>);
			case 3:
				return (
					<div class="spinner-4">
					<span class="circle color-1"></span>
					<span class="circle color-2"></span>
					<span class="circle color-3"></span>
				</div>);
		}

	}
	render(){
		return (
			<div>
				<div>{this.renderContent()}</div>
			</div>
		);
	}
}


export default Spinner;
